import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import { ThemeProvider, createTheme, CssBaseline } from "@mui/material";

// Auth Pages
import Login from "./pages/auth/Login";
import Register from "./pages/auth/Register";
import ForgotPassword from "./pages/auth/ForgotPassword";

// Admin Pages
import AdminDashboard from "./pages/admin/Dashboard";
import AdminUsers from "./pages/admin/Users";
import AdminProviders from "./pages/admin/Providers";
import AdminAdmins from "./pages/admin/Admins";
import AdminCategories from "./pages/admin/Categories";
import AdminCourses from "./pages/admin/Courses";
import AdminApps from "./pages/admin/Apps";
import AdminSliders from "./pages/admin/Sliders";
import AdminHomepageBlocks from "./pages/admin/HomepageBlocks";

// Provider Pages
import ProviderDashboard from "./pages/provider/Dashboard";
import ProviderUsers from "./pages/provider/Users";
import ProviderCourses from "./pages/provider/Courses";
import ProviderApps from "./pages/provider/Apps";

// User Pages
import UserDashboard from "./pages/user/Dashboard";
import UserCourses from "./pages/user/Courses";
import UserProfile from "./pages/user/Profile";
import UserCertificate from "./pages/user/Certificate";

const theme = createTheme();

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Routes>
        {/* Auth */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />

        {/* Admin Routes */}
        <Route path="/admin/dashboard" element={<AdminDashboard />} />
        <Route path="/admin/users" element={<AdminUsers />} />
        <Route path="/admin/providers" element={<AdminProviders />} />
        <Route path="/admin/admins" element={<AdminAdmins />} />
        <Route path="/admin/categories" element={<AdminCategories />} />
        <Route path="/admin/courses" element={<AdminCourses />} />
        <Route path="/admin/apps" element={<AdminApps />} />
        <Route path="/admin/sliders" element={<AdminSliders />} />
        <Route path="/admin/homepage-blocks" element={<AdminHomepageBlocks />} />

        {/* Provider Routes */}
        <Route path="/provider/dashboard" element={<ProviderDashboard />} />
        <Route path="/provider/users" element={<ProviderUsers />} />
        <Route path="/provider/courses" element={<ProviderCourses />} />
        <Route path="/provider/apps" element={<ProviderApps />} />

        {/* User Routes */}
        <Route path="/user/dashboard" element={<UserDashboard />} />
        <Route path="/user/courses" element={<UserCourses />} />
        <Route path="/user/profile" element={<UserProfile />} />
        <Route path="/user/certificate" element={<UserCertificate />} />

        {/* Default redirect */}
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </ThemeProvider>
  );
}

export default App;
